// src/components/layout/Navbar.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { ShoppingCart, Calendar, User, LogOut, Bell, ChevronDown, Search } from 'lucide-react';
import AuthModal from '../auth/AuthModal';

const Navbar = ({ isLoggedIn, userType, cartItems, setIsLoggedIn, setUserType }) => {
  const [isProfileOpen, setIsProfileOpen] = useState(false);
  const [isAuthOpen, setIsAuthOpen] = useState(false);
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    setIsLoggedIn(false);
    setUserType('buyer');
    setIsProfileOpen(false);
  };

  return (
    <>
      <nav className="bg-white shadow-lg sticky top-0 z-50">
        <div className="max-w-7xl mx-auto px-4">
          <div className="h-1 w-full bg-gradient-to-r from-green-400 to-emerald-600"></div>
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center justify-between w-full md:w-auto">
              <Link to="/" className="text-2xl font-bold text-green-600">Duty Dinar</Link>
              <button
                onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
                className="md:hidden rounded-lg p-2 hover:bg-gray-100 focus:outline-none"
              >
                <svg
                  className="h-6 w-6"
                  stroke="currentColor"
                  fill="none"
                  viewBox="0 0 24 24"
                >
                  {isMobileMenuOpen ? (
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth={2}
                      d="M6 18L18 6M6 6l12 12"
                    />
                  ) : (
                    <path
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      strokeWidth={2}
                      d="M4 6h16M4 12h16M4 18h16"
                    />
                  )}
                </svg>
              </button>
            </div>

            <div className="hidden md:flex items-center space-x-8">
              <Link to="/" className="text-gray-600 hover:text-green-600">Home</Link>
              <Link to="/categories" className="text-gray-600 hover:text-green-600">Categories</Link>
              <Link to="/events" className="text-gray-600 hover:text-green-600">Events</Link>
              {isLoggedIn && (
                <Link to="/dashboard" className="text-gray-600 hover:text-green-600">Dashboard</Link>
              )}
            </div>

            <div className="flex items-center space-x-4 md:space-x-6">
              <div className="relative hidden md:block">
                <input
                  type="text"
                  placeholder="Search products, suppliers..."
                  className="w-48 lg:w-64 px-4 py-2 rounded-lg border focus:outline-none focus:ring-2 focus:ring-green-500"
                />
                <Search className="absolute right-3 top-2.5 text-gray-400" size={20} />
              </div>

              {isLoggedIn ? (
                <>
                  <Bell className="text-gray-600 cursor-pointer" size={24} />
                  <div className="relative">
                    <ShoppingCart className="text-gray-600 cursor-pointer" size={24} />
                    {cartItems > 0 && (
                      <span className="absolute -top-2 -right-2 bg-red-500 text-white text-xs rounded-full w-5 h-5 flex items-center justify-center">
                        {cartItems}
                      </span>
                    )}
                  </div>
                  <div className="relative">
                    <button
                      onClick={() => setIsProfileOpen(!isProfileOpen)}
                      className="flex items-center space-x-2 text-gray-600"
                    >
                      <User size={24} />
                      <ChevronDown size={16} />
                    </button>
                    {isProfileOpen && (
                      <div className="absolute right-0 mt-2 w-48 bg-white rounded-lg shadow-lg py-2">
                        <Link to="/dashboard" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Dashboard</Link>
                        <Link to="/profile" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Profile</Link>
                        <Link to="/settings" className="block px-4 py-2 text-gray-800 hover:bg-gray-100">Settings</Link>
                        <hr className="my-2" />
                        <button 
                          onClick={handleLogout}
                          className="flex items-center px-4 py-2 text-red-600 hover:bg-gray-100 w-full"
                        >
                          <LogOut size={16} className="mr-2" />
                          Sign Out
                        </button>
                      </div>
                    )}
                  </div>
                </>
              ) : (
                <button 
                  onClick={() => setIsAuthOpen(true)}
                  className="bg-green-600 text-white px-4 py-2 rounded-lg hover:bg-green-700"
                >
                  Sign In / Register
                </button>
              )}
            </div>
          </div>

          {/* Mobile Menu */}
          <div className={`md:hidden ${isMobileMenuOpen ? 'block' : 'hidden'}`}>
            <div className="px-2 pt-2 pb-3 space-y-1">
              <Link to="/" className="block px-3 py-2 text-gray-600 hover:text-green-600">Home</Link>
              <Link to="/categories" className="block px-3 py-2 text-gray-600 hover:text-green-600">Categories</Link>
              <Link to="/events" className="block px-3 py-2 text-gray-600 hover:text-green-600">Events</Link>
              {isLoggedIn && (
                <Link to="/dashboard" className="block px-3 py-2 text-gray-600 hover:text-green-600">Dashboard</Link>
              )}
              <div className="relative mt-3">
                <input
                  type="text"
                  placeholder="Search..."
                  className="w-full px-4 py-2 rounded-lg border focus:outline-none focus:ring-2 focus:ring-green-500"
                />
                <Search className="absolute right-3 top-2.5 text-gray-400" size={20} />
              </div>
            </div>
          </div>
        </div>
      </nav>

      <AuthModal
        isOpen={isAuthOpen}
        onClose={() => setIsAuthOpen(false)}
        setIsLoggedIn={setIsLoggedIn}
        setUserType={setUserType}
      />
    </>
  );
};

export default Navbar;
